import React, { Component } from 'react';
import PropTypes from "prop-types"
import "/../img"

class IconItem extends Component {
  render() {
    return (
      <div>
        <p>{this.props.icon.name}</p>
      </div>
    );
  }
}

//PropTypes
IconItem.propTypes = {
  icon: PropTypes.object.isRequired
}

export default IconItem;
